    false,nt"url": null,nt"notes": "This narrative report for Mud Lake National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1942. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, fur animals, predators, and rodents- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, haying, and timber removal. The public relations section discusses
    Refuge visitors and Refuge participation. N-R forms are attached.",nt"owner_org":
